import React from 'react';
import images from "./imgs.js";
import Card from "./Card.jsx";


function createcard(props)
{
  return(
    <div>
      <Card key={props.id} val={props.pic}/>
    </div>
  );
}

function App() {
  return (
    <div >
      {images.map(createcard)}
      <img className="pic" scr="./images/1.jpg" alt="pic_img"/>
    </div>
  );
}

export default App;
